import React from "react";

export default function Timer(props){
    const timeUntil = props.birthday - props.currentTime;
    const [time, setTime] = React.useState(timeUntil);

    const updateTime=()=>{
        setTime(time - 1);
        setInterval(()=> {setTime(time - 1)},1000)
    }
    return(
        <p>
            {console.log(timeUntil)}
            {console.log(time)}
            {updateTime()}

        </p>
    );
}
